import React from "react";
import './style.css'

export function PageNotFound(props) {
    return (
        <body>
            <div className="content">
                <h2 className="text" data-text="Error 404">Error 404</h2>
            </div>
            <div className="text-404">
                <h1>You lost ?</h1>
                <p></p>
            </div>
        </body>
    )
}
